import { Layout } from 'antd';
import { Link } from 'react-router-dom'; // Asumiendo que estás utilizando React Router para la navegación

const { Header } = Layout;

function Navbar() {
  /* const navigate = useNavigate();*/

  return (
    <Header>
      <div>
        <Link to="/">Título de la Página</Link>
      </div>
    </Header>
  );
}

export default Navbar;
